import React, { Component } from 'react'
import { View, Text, TouchableOpacity, TextInput, StyleSheet, AsyncStorage, Slider, Image } from 'react-native';
import actions from "./actions";
import { connect } from "react-redux";
import { calcMapRegionAll } from './utils';
import MapViewType from "./MapViewType";
import GPlaces from './GPlaces';
import { Callout } from "react-native-maps";

class Navigation extends Component {
  constructor() {
    super();
    this.state = {
      onSearch: false
    };
  }

  change(value) {
    this.props.updateReduxState({ scaleWind: parseFloat(value) })
  }

  render() {
    return (
      <View>
        <View style={styles.container}>
          <TouchableOpacity
            style={styles.submitButton}
            onPress={
              () => {
                const mapRegion = calcMapRegionAll([...this.props.places, ...this.props.dangers]);
                if (mapRegion) {
                  this.props.updateReduxState({ mapRegion })
                }
              }}>
            <Text style={styles.submitButtonText}>All Markers</Text>
          </TouchableOpacity>

          <TouchableOpacity
            style={styles.submitButton}
            onPress={
              () => {
                if (this.props.viewType === 'Current') {
                  this.props.updateReduxState({ viewType: 'Historical' })
                } else {
                  this.props.updateReduxState({ viewType: 'Current' })
                }
              }
            }>
            <Text style={styles.submitButtonText}>View Type</Text>
          </TouchableOpacity>

          <TouchableOpacity
            style={styles.submitButton}
            onPress={
              () => console.log('Notifications')
            }>
            <Text style={styles.submitButtonText}>Notifications</Text>
          </TouchableOpacity>

        </View>
        <View style={styles.container}>
          <TouchableOpacity
            style={styles.submitButton}
            onPress={
              () => console.log('Subscription')
            }>
            <Text style={styles.submitButtonText}>Subscription</Text>
          </TouchableOpacity>

          <MapViewType style={styles.submitButton}/>

          <Slider
            style={styles.submitButton}
            step={1}
            maximumValue={10000000}
            onValueChange={this.change.bind(this)}
            value={this.props.scaleWind}
          />
        </View>
        <View style={styles.searchContainer}>
          <TouchableOpacity
            style={{ backgroundColor: 'white'}}
            onPress={() => this.setState({ onSearch: !this.state.onSearch })}>
            <Image
              style={{
                width: 20,
                height: 20,
                marginTop: 16,
                marginBottom: 14,
                marginLeft: 10,
                marginRight: 10,
              }}
              source={{
                uri:
                  'data:image/png;base64,',
              }}/>
          </TouchableOpacity>
          {this.state.onSearch ? <View style={styles.calloutView}>
            <GPlaces/>
          </View> : null}
        </View>
      </View>
    )
  }
}

function mapStateToProps(state) {
  return {
    places: state.get('places'),
    savePointSettings: state.get('savePointSettings'),
    dangers: state.get('dangers'),
    stations: state.get('stations'),
    stationsData: state.get('stationsData'),
    markerType: state.get('markerType'),
    viewType: state.get('viewType'),
    actionType: state.get('actionType'),
    isSavePointSettingsOpen: state.get('isSavePointSettingsOpen'),
    info: state.get('info'),
    scaleWind: state.get('scaleWind'),
  };
}

export default connect(mapStateToProps, actions)(Navigation);

const styles = StyleSheet.create({
  container: {
    backgroundColor: 'red',
    flexDirection: 'row',
    alignItems: 'stretch',
    flex: 1,
    width:400,
  },
  searchContainer: {
    marginBottom: 0,
    paddingBottom: 0,
    margin: 10,
    marginRight: 50,
    flexDirection: "row",
    // backgroundColor: 'white'
  },
  calloutView: {
    flexDirection: "row",
    // justifyContent: 'right',
    backgroundColor: "rgba(255, 255, 255, 1)",
    // borderRadius: 10,
    width: "88%",
    // marginLeft: "10%",
    // marginRight: "10%",
    // marginTop: 20,
  },
  submitButton: {
    backgroundColor: '#7a42f4',
    padding: 10,
    margin: 5,
    height: 40,
    flex:1
  },
  submitButtonText: {
    color: 'white'
  }
});
